import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { LoginComponent } from './login/login.component';
import { GroupChatsComponent } from './group-chats/group-chats-list.component';
import { PrivateChatsListComponent } from './private-chats-list/private-chats-list.component';

const routes: Routes = [
  { path: 'login', component: LoginComponent },
  { path: 'group-chats', component: GroupChatsComponent },
  { path: 'private-chats', component: PrivateChatsListComponent}
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
